import { ArrowBack, ArrowForwardIos } from '@material-ui/icons';
import './index.scss';

export function HomePage() {
    return (
        <main>
            <aside>
                <h1>Arizapp</h1>
            </aside>
            <div className="content">
                <div className="content-indicate arrow">
                    <ArrowForwardIos sx={{ fontSize: '1.6em' }} />
                </div>
                <div className="content-container">
                    <div className="formContent">
                        <div className="formContent-header">
                            <h1>Login</h1>
                        </div>
                    </div>
                </div>
            </div>
        </main>
    );
}
